import completeCheck from '../images/completeCheck.png'
import '../assets/stepper.css'
const Label = ({ title, isComplete }) => {
  return (
    <div className="stepper-label" >
      <p>{title}</p>
      {/* {isComplete && <img width="20px" style={{ marginLeft: "5px", height: "20px", alignSelf: "center" }} src={completeCheck} />} */}
    </div>
  );
}

export default Label;
